import React from 'react';
//style
import 'bootstrap/dist/css/bootstrap.min.css';
import './Header.css';

// import page

import Main from '../view/Homepage';
import About from '../view/About';
import CardList from '../view/CardList';
import Rule from '../view/Rule';
import Game from '../view/Game';

//import router
import {
  BrowserRouter as Router,
  Route,
  Link,
  NavLink,
  Switch,
  Redirect
} from "react-router-dom";

class Header extends React.Component{
	render(){
		return (
			<div className='Header'>
				<nav className='navbar navbar-expand-lg bg-secondary text-uppercase fixed-top' id='mainNav'>
				<Router>
					<NavLink to='/' className = 'homepage'>Home</NavLink>
					<NavLink to='/about' className = 'homepage'>About</NavLink>
					<NavLink to='/cl' className = 'homepage'>Card List</NavLink>
					<NavLink to='/rule' className = 'homepage'>Game Rule</NavLink>
					<NavLink to='/game' className = 'homepage'>Play</NavLink>





					<Route path ='/' exact component = {Main}/>
					<Route path ='/about' component = {About}/>
					<Route path ='/cl' component = {CardList}/>
					<Route path ='/rule' component = {Rule}/>
					<Route path ='/game' exact component = {Game}/>
				</Router>
				</nav>
			</div>
		);
	}
}

export default Header;
